alse,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.257346347607053,\"y\":92.00671641791045,\"width\":98.53904282115869,\"height\":7.562189054726368,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Flowers that contain all parts (petals, sepals, stamens and pistil) are called<span style=\\\"color:#c0392b\\\"><strong> complete flowers.</strong></span></p>\\n\"},\"subContentId\":\"b15f97c9-36fc-4a65-abab-7bc86179e754\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}]},{\"elements\":[{\"x\":1.7632241813602014,\"y\":4.975124378109453,\"width\":98.0352644836272,\"height\":39.900497512437816,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Some plants, such as orange trees, carry <strong>complete flowers.</strong></p>\\n\\n<p>Other plants, like corn, carry two kinds of flowers on the same plant: <strong>the male flowers</strong> (containing only stamens) found on the upper part of the corn plant. <strong>The female flowers</strong> (containing only a pistil) distributed along the stem of the <strong>same plant.</strong></p>\\n\\n<p>In a third case, the whole plant is either male or female, which means that male flowers and the female flowers are found on <strong>separate plants.</strong> Examples are palm trees and kiwi.</p>\\n\\n<p> </p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f1713e4e-55ea-4ec6-b543-ab10adcebea1\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":0,\"y\":47.777860696517415,\"w  the <strong>ovary</strong> becomes a <strong>fruit </strong>and the <strong>ovule</strong> becomes a <strong>seed</strong> where the fertilized egg becomes a miniature plant.</p>\\n\\n<p>Other parts of the flower wilt and fall off.</p>\\n\"},\"subContentId\":\"d50832a2-0a86-433c-94b7-240fa88f2f49\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}]},{\"elements\":[{\"x\":1.2531486146095716,\"y\":9.937810945273633,\"width\":37.58186397984886,\"height\":56.81592039800996,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgb(245, 237, 237)\",\"borderWidth\":\"2\",\"borderStyle\":\"solid\",\"borderColor\":\"#000\",\"borderRadius\":\"0\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"subContentId\":\"c8a517c8-776a-4a97-8c6d-79336d466104\",\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\",\"title\":\"Untitled Shapes\"}},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":2.514697732997481,\"y\":19.89221393034826,\"width\":34.68513853904282,\"height\":41.8905472636816,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4SQ/RXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAABAAAAagEoAAMAAAABAAIAAAExAAIAAAAeAAAAcgEyAAIAAAAUAAAAkIdpAAQAAAABAAAApAAAANAACvyAAAAnEAAK/IAAACcQQWRvYmUgUGhvdG9zaG9wIENTNiAoV2luZG93cykAMjAyMDowMjoxNCAxMDoyNDo1MwAAA6ABAAMAAAABAAEAAKACAAQAAAABAAADiKADAAQAAAABAAACJAAAAAAAAAAGAQMAAwAAAAEABgAAARoABQAAAAEAAAEeARsABQAAAAEAAAEmASgAAwAAAAEAAgAAAgEABAAAAAEAAAEuAgIABAAAAAEAACMJAAAAAAAAAEgAAAABAAAASAAAAAH/2P/iDFhJQ0NfUFJPRklMRQABAQAADEhMaW5vAhAAAG1udHJS
